import React, {useState, useEffect} from 'react';
import { Container, Button, Row, Col, ListGroup, Image } from 'react-bootstrap';
import products from '../product';

export function CartPage() {
    
    const productsInCart = products.slice(0,2);

    return (
        <Container className='mt-5 product-display-container'>
            <h1>Your Cart</h1>

            <Col>
                {productsInCart.map(product => (
                    <Row>
                        <ListGroup horizontal>
                            <ListGroup.Item>
                                <Image src={`http://127.0.0.1:8000${product.image}`}></Image>
                            </ListGroup.Item>
                        </ListGroup>
                    </Row>
                ))}  
            </Col>
        
        </Container>
    )
}
